import React from 'react';

export default function About() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-4xl font-bold mb-4">About StonePedia</h1>
      <p className="mb-4">
        StonePedia is your ultimate guide to premium and popular stones. We are dedicated to providing comprehensive information about various types of stones, their properties, and their applications in architecture and design.
      </p>
      <p>
        Our team of experts curates high-quality content to help you make informed decisions about stone selection for your projects. Whether you're a professional in the construction industry or a homeowner looking to renovate, StonePedia is your trusted resource for all things stone-related.
      </p>
    </div>
  );
}
